    [],nt"revision_timestamp": "2016-03-04T20:42:17.694280",nt"name": "california-red-tree-vole-ds33dcf27",nt"isopen":
    false,nt"url": null,nt"notes": "The data set represents the known observations
    of California red tree voles where each point represents a section where one or
    more voles have been found. Observations listed here were made from 1984 through
    2000. There are a number of reports from literature of specimens taken included,
    but most of these lack a specific date that the animals were taken. However, most
    of these specimens were likely to have been taken in the late 1980's when there
    was a big effort made to clarify red tree vole taxonomy which led to the establishment
    of the California red tree vole as a separate species. Field biologists and foresters
    looked for and recorded tree vole nests while surveying forest habitats and in checking
    proposed timber harvest sites. Researchers trapped tree voles to determine the species'
    genetics and recorded the location of the trapping site. Likewise, some industrial
    timber companies surveyed for tree voles using live traps to document the occurrence
    of these voles on their lands. There are 448 records where each is a summary of
    one or more vole observations in a unique one-mile square section represented by
    those sections on USGS Quad. maps. Most records come from Humboldt and Mendocino
    counties though they are present in counties from Oregon through Sonoma County and
    inland in Siskiyou and Trinity counties. WHAT EACH RECORD REPRESENTS: Each record
    provides location information as to the smallest part of a section where all of
    the observations of tree voles in that section have been located. Also, there is
    information on when a tree vole was last seen at that described part of that section,
    and how many tree vole nests were seen and/or how many tree voles were capture during
    surveys or for specimens. A field showing land ownership has been only partially
    completed and each record also references the document number(s) for the substantiating
    report of the observation on file with the Department.",nt"license_title":
